import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { createPriority } from './PrioritySlice';

export const AddPriority = () => {
  const dispatch = useDispatch();
  const { loading, error } = useSelector((state) => state.priority);

  const [priorityData, setPriorityData] = useState({
    priority_name: '',
    owner: '',
    start_value: 0,
    current_value: 0,
    target: 0,
    current_value_source: 'manual entry',
  });

  const handleChange = (e) => {
    setPriorityData({
      ...priorityData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch(createPriority(priorityData));
  };

  const handleCancel = () => {
    setPriorityData({
      priority_name: '',
      owner: '',
      start_value: 0,
      current_value: 0,
      target: 0,
      current_value_source: 'manual entry',
    });
  };

  return (
    <div style={{ maxWidth: '600px', margin: '0 auto', padding: '20px', border: '1px solid #ccc', borderRadius: '8px' }}>
      <h2>Add Priority</h2>
      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="priority_name" style={{ display: 'block', marginBottom: '5px' }}>Priority Name</label>
          <input
            type="text"
            name="priority_name"
            placeholder="Priority Name"
            value={priorityData.priority_name}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', border: '1px solid #ccc', borderRadius: '4px' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="owner" style={{ display: 'block', marginBottom: '5px' }}>Owner</label>
          <input
            type="text"
            name="owner"
            placeholder="Owner"
            value={priorityData.owner}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', border: '1px solid #ccc', borderRadius: '4px' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="start_value" style={{ display: 'block', marginBottom: '5px' }}>Start Value</label>
          <input
            type="number"
            name="start_value"
            placeholder="Start Value"
            value={priorityData.start_value}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', border: '1px solid #ccc', borderRadius: '4px' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="current_value" style={{ display: 'block', marginBottom: '5px' }}>Current Value</label>
          <input
            type="number"
            name="current_value"
            placeholder="Current Value"
            value={priorityData.current_value}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', border: '1px solid #ccc', borderRadius: '4px' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="target" style={{ display: 'block', marginBottom: '5px' }}>Target</label>
          <input
            type="number"
            name="target"
            placeholder="Target"
            value={priorityData.target}
            onChange={handleChange}
            required
            style={{ padding: '10px', width: '100%', border: '1px solid #ccc', borderRadius: '4px' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label htmlFor="current_value_source" style={{ display: 'block', marginBottom: '5px' }}>Current Value Source</label>
          <div>
            <label>
              <input
                type="radio"
                name="current_value_source"
                value="manual entry"
                checked={priorityData.current_value_source === 'manual entry'}
                onChange={handleChange}
                required
                style={{ marginRight: '5px' }}
              />
              Manual Entry
            </label>
            <label style={{ marginLeft: '20px' }}>
              <input
                type="radio"
                name="current_value_source"
                value="connect a metric"
                checked={priorityData.current_value_source === 'connect a metric'}
                onChange={handleChange}
                required
                style={{ marginRight: '5px' }}
              />
              Connect a Metric
            </label>
          </div>
        </div>
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
          <button type="submit" disabled={loading} style={{ padding: '10px 20px', border: 'none', borderRadius: '4px', backgroundColor: '#007BFF', color: '#fff' }}>
            {loading ? 'Submitting...' : 'Submit'}
          </button>
          <button type="button" onClick={handleCancel} style={{ padding: '10px 20px', border: 'none', borderRadius: '4px', backgroundColor: '#6c757d', color: '#fff' }}>
            Cancel
          </button>
        </div>
        {error && <p style={{ color: 'red', marginTop: '15px' }}>{error.message}</p>}
      </form>
    </div>
  );
};
